var build = (function () {
    return {
        init : function () {
            var carriageret = '\r\n',
            ypos = 0,
            sections = [],
            coursedata = rebus.stateHelper.get();
            var getdata = function(prop)
            {
                if(typeof coursedata[prop] === 'undefined' || coursedata[prop].indexOf('~|~') === -1) return "";
                var parts = coursedata[prop].split('~|~');
                return {
                    'title': parts[2],
                    'body': parts[1]
                }
            }
            for(var prop in coursedata)
            {
                if(coursedata[prop].indexOf('~|~') !== -1) { sections.push(getdata(prop)); }
            }            
            if(rebus.config.id.indexOf('esa-explicit-m3') >-1){
                sections.splice(4,0,sections.splice(2,1)[0]);                
            }
            var xmargin = 15;
            var ymargin = 40;
            // new instance
            var doc = new jsPDF({
                orientation: 'p',
                unit: 'mm',
                format: 'a4'
            });
            doc.setLineHeightFactor(1.3);
            // max page question heights and widths
            var pageHeight = (doc.internal.pageSize.height);
            var pageWidth = (doc.internal.pageSize.width - (xmargin * 2));
            var drawFooter = function(ypos){
                var footer = new Image();
                footer.src = "";
                doc.addImage(footer, "PNG", 0, ((doc.internal.pageSize.height - (doc.internal.pageSize.width * 0.0786290322580645))), doc.internal.pageSize.width, (doc.internal.pageSize.width * 0.0786290322580645));
            }
            var drawHeader = function () {
                // reset ypos
                ypos = ymargin;
                //
                //ADD Header (base64 encoded)
                var header = new Image();
                header.src = "data:image/png;base64, ";
                doc.addImage(header, "PNG", 0, 0, doc.internal.pageSize.width, (doc.internal.pageSize.width * 0.0940860215053763));
                // ADD HEADING
                doc.setFontType('bold');
                doc.setFontSize(10);
                doc.setTextColor(0);
                doc.text("Module 1 - Understanding customer misbehaviour", 100,  ypos);
                ypos += 10;
                doc.setFontSize(16);
                doc.setTextColor(0);
                doc.text('Case study in Action', xmargin,  ypos);
                ypos += 10;

               /* doc.setFontSize(13);
                doc.setTextColor(0);
                doc.text('Case study example', xmargin,  ypos);
                ypos += 10;*/


                // set font size/colour for body copy
                doc.setFontSize(11);
                doc.setTextColor(0);
            }
            drawHeader();
            // loop through sections

            sections[0].title =  "Case study example";
            sections[0].extra = "Use these notes as your guide to remember key tips to handle customer misbehaviour in future."            
            sections[1].extra = "Did your response include:[,]connecting with the customer as an individual[,]making eye contact[,]actively listening to what they say?"
            sections[2].extra = "Did your response include using your breath to manage your reaction to the customer’s emotion?"
            sections[3].extra = "Did your response include:[,]acknowledging the customer’s situation[,]reframing your thinking to take the customer’s perspective?"
            sections[4].extra = "Did your response include an observation about the customer’s physical features, clothing or behaviour, which may have formed an impression of them?"
            sections[5].extra = "Did your response include being yourself and smiling?"
            

            
            sections.forEach(function (section, ix) {

                    var extra = section.extra;
                    var title = section.title;
                    var body = section.body;                    
                    if(extra.indexOf('[,]') !== -1) 
                    {
                        extra = extra.split('[,]').join(carriageret+'  • ');
                        extra = '  • '+extra;
                        extra = extra.substring(4);
                    }

                    var split_extra = [];
                    var split_title = [];
                    var split_body = [];

                    split_extra = doc.splitTextToSize(extra, pageWidth);
                    split_title = doc.splitTextToSize(title, pageWidth - 15);
                    split_body = doc.splitTextToSize(body, pageWidth);

                    var lineheight_extra    = doc.getLineHeight(split_extra) / doc.internal.scaleFactor;
                    var lineheight_title   = doc.getLineHeight(split_title) / doc.internal.scaleFactor;
                    var lineheight_body    = doc.getLineHeight(split_body) / doc.internal.scaleFactor;

                    var totalheight = ((lineheight_extra * split_extra.length) + (lineheight_title * split_title.length) + (lineheight_body * split_body.length));
                    // add new page and header
                    if(ypos + totalheight >= (pageHeight - 15)) { 
                      //  drawFooter(pageHeight);
                        doc.addPage();
                        drawHeader(); 
                    }
                    


                    if(ix != -1){
                        /*
                        doc.setFontType('normal');
                        doc.text(split_extra, xmargin, ypos);
                        ypos += ((lineheight_extra * split_extra.length) + 8);
    
                         //title
                        doc.setFontType('bold');
                        doc.text(split_title, xmargin, ypos);                                            
                        ypos += ((lineheight_title * split_title.length) - 3);

                         //bopy
                        doc.setFontType('normal');
                        doc.text(split_body, xmargin, (ypos += 5));                        
                        ypos += (lineheight_body * split_body.length);
                        doc.text("", xmargin, (ypos += 5));
*/

                    }
                    
                        //title

                        doc.setFontType('bold');
                        doc.text(split_title, xmargin, ypos);                                            
                        ypos += ((lineheight_title * split_title.length) - 3);

                        doc.setFontType('normal');
                        doc.text(split_body, xmargin, (ypos += 5));                        
                        ypos += (lineheight_body * split_body.length);
                        doc.text("", xmargin, (ypos += 5));
                        //extra
                        doc.setFontType('normal');
                        if(ix != 0){
                            doc.setTextColor(0, 76, 151);
                        }
                        
                        doc.text(split_extra, xmargin, ypos);
                        ypos += ((lineheight_extra * split_extra.length) + 8);
                        doc.setTextColor(0);

           
            });
            let today = (function(){
                let theday = new Date();
                const offset = theday.getTimezoneOffset()
                theday = new Date(theday.getTime() - (offset*60*1000))
                return theday.toISOString().split('T')[0]
            })()
           doc.save(rebus.config.title+'_'+today+".pdf");
        }
    }
})();

export default {
    build: build
};